import React, { useState } from "react";
import SignUp from "./SignUp";
import SignIn from "./SignIn";
import {
  Typography,
  IconButton,
  DialogActions,
  DialogTitle,
  DialogContent,
  Dialog,
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";

export default function DialogWrapper(props) {
  const { dialogOpen, handleDialogClose } = props;
  const [toggleSignUp, setToggleSignUp] = useState(true);

  const handleSignUpToggle = () => {
    setToggleSignUp(!toggleSignUp);
  };

  return (
    <div>
      <Dialog open={dialogOpen} onClose={handleDialogClose}>
        <DialogTitle style={{ textAlign: "end" }}>
          <IconButton onClick={handleDialogClose}>
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <DialogContent>{toggleSignUp ? <SignUp /> : <SignIn />}</DialogContent>
        <DialogActions style={{ justifyContent: "center" }}>
          {setToggleSignUp ? (
            <Typography onClick={handleSignUpToggle} variant="body2">
              Already have an account? Sign In
            </Typography>
          ) : (
            <Typography onClick={handleSignUpToggle} variant="body2">
              Don't have an account yet? Sign Up
            </Typography>
          )}
        </DialogActions>
      </Dialog>
    </div>
  );
}
